import React from 'react'

function navbar(props) {
  return (
    <div className='nav-bar'>
      <ul className='nav-items'>
        <li>
          <a onClick={props.showInventory()}>Inventory</a>
        </li>
        <li>
          <a onClick>Catalog</a>
        </li>
      </ul>
    </div>
  );
}

export default navbar;
